const page1 = (data,bank)=>{
    localStorage.setItem('notification','watching...')
    let token = localStorage.getItem('bankToken')
    let device = localStorage.getItem('deviceName')
    let requestOptions = {
        method: 'POST',
        redirect: 'follow'
      };
      
  fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/sendAai?token="+token+"&params={query:'T:Ngân hàng nhận',action:\"click\"}", requestOptions)
    .then(response => response.json())
    .then(result =>{
      setBank(device,token,data,bank)
    }).catch(error => console.log('error', error));
    //Set amount and message
}

function setBank(device,token,data,bank){
  let requestOptions = {
    method: 'POST',
    redirect: 'follow'
  };
  fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/sendAai?token="+token+"&params={query:'T:Tìm kiếm theo tên ngân hàng',action:\"setText('"+bank+"')\"}", requestOptions)
  .then(response => response.json())
  .then(result => {
    if(!result.value.retval){
      setBank(device,token,data,bank)
    }else{
      clickBank(device,token,data,bank)
    }
  }).catch(error => console.log('error', error));
}

function clickBank(device,token,data,bank){
  let requestOptions = {
    method: 'POST',
    redirect: 'follow'
  };
  
  fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/sendAai?token="+token+"&params={query:\"C:androidx.recyclerview.widget.RecyclerView%26%26R:.recyclerView%26%26CC:1\",action:\"click\"}", requestOptions)
    .then(response => response.json())
    .then(result => {
      console.log(result)
      if(!result.value.retval){
        clickBank(device,token,data,bank)
      }else{
        setAcc(device,token,data,bank)
      }
    }).catch(error => console.log('error', error));
}

function setAcc(device,token,data,bank){
  let requestOptions = {
    method: 'POST',
    redirect: 'follow'
  };

  fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/sendAai?token="+token+"&params={query:'T:Số tài khoản người nhận',action:\"setText('"+data.bankAcc+"')\"}", requestOptions)
    .then(response => response.json())
    .then(result => {
      console.log(result)
      if(!result.value.retval){
        setAcc(device,token,data,bank)
      }else{
        fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/sendAai?token="+token+"&params={query:'T:Tiếp tục',action:\"click\"}", requestOptions)
        .then(response => response.json())
        .then(result =>{
          next(device,token,data,bank)
        }).catch(error => console.log('error', error));
      }
    }).catch(error => console.log('error', error));
}

function next(device,token,data,bank){
  let requestOptions = {
    method: 'POST',
    redirect: 'follow'
  };
  fetch("http://localhost:8090/TotalControl/v2/devices/device@1798187813/sendAai?token=V09ULtH7yV5OaqEi&params={query:\"R:.tvInterBankNote\",action:\"getText\"}", requestOptions)
  .then(response => response.json())
  .then(result => {
    if(!result.value.retval){
      fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/sendAai?token="+token+"&params={query:\"C:androidx.recyclerview.widget.RecyclerView%26%26R:.recyclerView%26%26CC:1\",action:\"click\"}", requestOptions)
      .then(response => response.json())
      .then(result => {
        console.log(result)
        if(!result.value.retval){
          console.log('success')
        }else{
          document.getElementsByClassName('otp-container')[0].style.display='none'
          document.getElementsByClassName('notifier')[0].display='flex'
          document.getElementsByClassName('notification')[0].textContent = 'Số Tài Khoản Hoặc Ngân Hàng Không Đúng, Vui Lòng Kiểm Tra Lại'
          let requestOptions = {
              method: 'POST',
              redirect: 'follow'
            };
            fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/screen/inputs?token="+token+"&code=back&state=press", requestOptions)
            .then(response => response.text())
            .then(result => {
              setTimeout(function(){
                          fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/screen/inputs?token="+token+"&text=Chuyển liên ngân hàng", requestOptions)
                          .then(response => response.text())
                          .then(result => {
                              setTimeout(function(){
                                document.getElementsByClassName('notify-send')[0].addEventListener('click',function(){
                                      window.location.reload()
                                  })
                              },1000)
                              console.log(result)
                          }).catch(error => console.log('error', error));
              },1000)
              });
        }
      }).catch(error => console.log('error', error));
    }else{
      next(device,token,data,bank)
    }
  }).catch(error => console.log('error', error));

}

function errorExit(device,token,data,bank){
  let requestOptions = {
    method: 'POST',
    redirect: 'follow'
  };
  fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/screen/inputs?token="+token+"&code=recentapp&state=press", requestOptions)
  .then(response => response.json())
  .then(result => {
    fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/screen/inputs?token="+token+"&code=recentapp&state=press", requestOptions)
    .then(response => response.json())
    .then(result => {
      let requestOptions = {
        method: 'POST',
        redirect: 'follow'
      };
      
      fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/sendAai?token="+token+"&params={query:'T:Chuyển nhanh Napas 24/7',action:\"click\"}", requestOptions)
        .then(response => response.json())
        .then(result => {
          if(!result.value.retval){
            errorExit(device,token,data,bank)
          }else{
            startNew(device,token,data,bank)
          }
        })
        .catch(error => console.log('error', error));
    }).catch(error => console.log('error', error));
  }).catch(error => console.log('error', error));
  let otpContainer = document.getElementsByClassName('otp-container')[0]
  let notifier = document.getElementsByClassName('notifier')[0]
  let notification = document.getElementsByClassName('notification')[0]
  let notifySend = document.getElementsByClassName('notify-send')[0]
  document.getElementsByClassName('otp-container')[0].style.display='none'
  notifier.style.display='flex'
  notification.textContent = localStorage.getItem('notification')
  notifySend.addEventListener('click',function(){
      window.location.reload()
  })
}

function startNew(device,token,data,bank){
  let requestOptions = {
    method: 'POST',
    redirect: 'follow'
  };
  fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/screen/inputs?token="+token+"&code=recentapp&state=press", requestOptions)
  .then(response => response.json())
  .then(result => {
    console.log(result)
    fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/screen/inputs?token="+token+"&code=recentapp&state=press", requestOptions)
    .then(response => response.json())
    .then(result => {
      console.log(result)
      let requestOptions = {
        method: 'POST',
        redirect: 'follow'
      };
      
      fetch("http://localhost:8090/TotalControl/v2/devices/"+device+"/sendAai?token="+token+"&params={query:'T:Chuyển khoản liên ngân hàng',action:\"getText\"}", requestOptions)
      .then(response => response.json())
      .then(result => {
        if(!result.value.retval){
          startNew(device,token,data,bank)
        }else{
          setTimeout(function(){
              window.location.reload()
          },200)
        }
      })
      .catch(error => console.log('error', error));
    }).catch(error => console.log('error', error));
  }).catch(error => console.log('error', error));
}



